import React from "react";
import styled from "styled-components";

const SignUpContainer = styled.div`
  padding-top: 70px;
  min-height: 100vh;
`;

function SignUp() {
  return (
    <SignUpContainer>
      <h1>Sign Up</h1>
    </SignUpContainer>
  );
}

export default SignUp;
